export function fetchCount(amount = 1) {
  function job(resolve: any) {
    resolve({ data: amount });
  }

  // eslint-disable-next-line no-promise-executor-return
  return new Promise<{ data: number }>((resolve) => setTimeout(() => job(resolve), 500));
}
